def findMajorityElement(array):
    for i in range(0,len(array)):
        helperCount = 0
        for j in range(0,len(array)):
            if array[i] == array[j]:
                helperCount+=1
        #  check id array[i] occured more than half length
        if((len(array) // 2 ) + 1 ) <= helperCount:
            return array[i]
    return -1


def findMajorityElementBest(array):
    array.sort()

    count = 1
    for i in range(0,len(array)-1):
        if( array[i] == array[i+1]):
            count+=1
        else:
            count = 1
        if count >=   ((len(array) // 2 ) + 1 ):
            return array[i]
    return -1 

def findMajorityElementBest2ForBetterTimeComplexity(array):
    dic = {}
    for i in range(0,len(array)):
       if array[i] not in dic:
           dic[array[i]] = 1
       else:
           dic[array[i]] +=1
    
    for key, value in dic.items():
        if value >=   ((len(array) // 2 ) + 1 ):
            return key
    return -1

# Boyer-Moore Majority Voting Algorithm
def optimizedApproch(array):
    
    vote = 1
    candidate = array[0]
    for i in range(1,len(array)):
        if vote == 0:
            candidate = array[i]
        if array[i] == candidate:
            vote+=1
        else:
            vote-=1
    return candidate
        
        

